import FloatingCards from './components/FloatingCards';
import FloatingSpheres from './components/FloatingSpheres';
import HeroSection from './components/HeroSection';
import Navigation from './components/Navigation';
import './styles/globals.css';

function App() {
  return (
    <div style={{
      backgroundColor: '#0A0B0F',
      color: '#FFFFFF',
      minHeight: '100vh',
      overflow: 'hidden',
      position: 'relative',
    }}>
      <Navigation />

      <main style={{
        maxWidth: '1400px',
        margin: '60px auto',
        padding: '0 40px',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        position: 'relative',
      }}>
        <HeroSection />

        <div style={{
          position: 'relative',
          width: '600px',
          height: '600px',
        }}>
          <FloatingCards />
          <FloatingSpheres />
        </div>
      </main>
    </div>
  );
}

export default App;
